import { useRouteMatch } from 'react-router-dom';

function Category(props) {
    let mutch = useRouteMatch()
    let CatNav = props.data;
    const listCat = CatNav.map(item =>
        <li><a href={mutch.url}> {item.text}</a> </li>
    );
    return (
        <>
            <h1>Category</h1>
            <ul>
                {listCat}
            </ul>
        </>
    );
}

export default Category;
